    return(
        <div>
            <ul>
                <li>About us</li>
                <li>Portfolio</li>
                <li>contact</li>
                <li>Packages</li>
            </ul>
            <div>
                <a><img src='../assets/facebook.png' alt='facebook'/></a>
            </div>
        </div>
    )
}

